ScopeOfService:
Fire Engineering - Initial desktop study of the drawings. To facilitate design progression, we will prepare marked up drawings detailing a thorough review of the proposed scheme. These will highlight potential approval risks and provide recommendations to enable the Planning application to be made. 
Areas covered will include: 
Means of escape; 
Compartmentation requirements; 
Detection and alarm systems; 
Smoke venting systems requirements; 
Requirements for sprinkler systems; 
Requirements to minimise external fire spread; 
Fire fighting access, i.e. external access. 

We will also identify potential fire engineered solutions that can be developed and ensure maximum cost-benefit in the design.

Review of Stage D/ E fire strategy with a view to Arup taking the project on from incumbent engineering team.
We will consider using HTM 05 and provide comment on the proposals with regards to:
• Sacrificial slabs;
• Bypass corridors;
• Link bridges;
• Fire detection/ sounder provisions, especially in ancillary spaces;
• Fire rated ductwork/ fire damper types and location linked to compartmentation;
• Interaction with controls, CCTV, access systems; and
• Impact of geometry on the provisions generally.

